import React, { Component } from 'react';
import './App.css';
import NavBar from './components/Navbar'
class App extends Component {

  state = {
    workouts: []
  }

  componentDidMount(){
    fetch('http://localhost:3001/workouts')
    .then(res => res.json())
    .then(workouts => this.setState({workouts}))
  }

  render() {
    console.log(this.state.workouts )
    return (
      <div>
        <NavBar />
      </div>
    );
  }
}

export default App;
